import React from 'react';
import { Typography } from '@mui/material';

function KDAInfo({ kills, deaths, assists }) {
  return (
    <Typography variant="body2">
      {kills}/{deaths}/{assists} K/D/A
    </Typography>
  );
}

export default KDAInfo;
